import React from 'react';
import { useHistory } from 'react-router-dom';

const Home = () => {
  const history = useHistory();
  const handleClick = () => history.push('/about');

  return (
    <button type="button" onClick={handleClick}>
      Add User
    </button>
  );
};

export default Home;
